import React from "react";
import "../css/CsvHeader.css";

const CsvHeader = ({ header, newData }) => {

  let arr = [];
  for (let i = 0; i < newData.length; i++) {
    arr.push(newData[i][`"${header}`]);
  }

  console.log(arr)


  return (
    <div className="csv-header">
      <h1>{header}</h1>
      {arr.map((item) => {
        return <p>{item}</p>;
      })}
    </div>
  );
};

export default CsvHeader;
